function ButtonEditAndExit(props) {
  return (
    <>
      <button className='profile__edit  effect profile__edit_error' type="button" onCl>Редактировать</button>
      <div className='profile__logout  effect' onClick={props.signOut}>Выйти из аккаунта</div>
    </>
  )
}

export default ButtonEditAndExit;
